// @downloadURL https://update.greasyfork.org/scripts/460259/Ultra%2B%20Alert.user.js
// @updateURL https://update.greasyfork.org/scripts/460259/Ultra%2B%20Alert.meta.js
// ==/UserScript==

const alarmSound = new Audio(
    'data:audio/mp3;base64, '
);
alarmSound.volume = 0.15;

const tts = new SpeechSynthesisUtterance();
tts.lang = 'en';
tts.voice = window.speechSynthesis.getVoices()[0];
tts.pitch = 2;

const rarities = [
    {
        type: 'Ultra',
        color: '#ff2b75',
        sound: alarmSound,
    },
    {
        type: 'Super',
        color: '#2bffa3',
        sound: alarmSound,
    },
];

var collectedTexts = new Set();

hookCtx('fillText', (target, thisArg, args) => {
    const text = args[0];
    const rarity = rarities.find((x) => x.color == thisArg.fillStyle);

    if (!rarity || !new RegExp(`${rarity.type}.*spawned!`).test(text)) {
        return;
    }

    if (collectedTexts.has(text)) {
        return;
    }
    collectedTexts.add(text);
    setTimeout(() => collectedTexts.delete(text), 1000 * 60 * 60);

    playAlert(rarity.sound, text);
});

// Tampermonkey menu
GM_registerMenuCommand('Test Alert', (event) => {
    playAlert(alarmSound, `An Ultra Beetle has spawned!`);
});

// functions
function playAlert(sound, message) {
    sound.play();
    tts.text = `Attention, Attention! ${message}`;
    window.speechSynthesis.speak(tts);
}

function hookCtx(method, consumer) {
    const target = window.CanvasRenderingContext2D.prototype;
    target[method] = new Proxy(target[method], {
        apply(target, thisArg, args) {
            consumer(target, thisArg, args);
            return Reflect.apply(target, thisArg, args);
        },
    });
}
